-- ----------------------------
-- Table structure for commodity
-- ----------------------------
DROP TABLE IF EXISTS `commodity`;
CREATE TABLE `commodity` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `commodity_num` varchar(255) NOT NULL COMMENT '商品编号（MF1500）',
  `search` varchar(255) DEFAULT NULL,
  `product_num` bigint(11) NOT NULL COMMENT '库存',
  `sold_out_num` bigint(11) DEFAULT '0' COMMENT '已售数量',
  `trade_name` varchar(255) DEFAULT NULL COMMENT '商品名',
  `market_price` decimal(12,2) NOT NULL COMMENT '市场价格',
  `promotion_price` decimal(12,2) NOT NULL COMMENT '活动价格',
  `create_time` datetime DEFAULT NULL,
  `create_user_id` bigint(20) DEFAULT NULL,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `update_user_id` bigint(20) DEFAULT NULL COMMENT '修改人',
  `tea_name` varchar(20) DEFAULT NULL COMMENT '茶名（官方定义茶名）',
  `product_type` varchar(20) DEFAULT NULL COMMENT '产品类别(茶叶类别，红茶等）',
  `pick_year` varchar(10) DEFAULT NULL COMMENT '采摘年份',
  `pick_season` varchar(10) DEFAULT NULL COMMENT '采摘季节',
  `goods_grade` varchar(10) DEFAULT NULL COMMENT '商品等级（特级等）',
  `net_content` int(20) DEFAULT NULL COMMENT '净含量',
  `purpose` int(20) DEFAULT NULL COMMENT '用途（自饮1、送礼2（简装礼盒）+送礼（精装礼盒））',
  `specification` varchar(50) DEFAULT NULL COMMENT '规格',
  `origin_place` varchar(255) DEFAULT NULL COMMENT '产地',
  `food_production_licence` varchar(255) DEFAULT NULL COMMENT '食品生产许可证',
  `store_method` varchar(255) DEFAULT NULL COMMENT '储藏方法',
  `expiration_data` int(255) DEFAULT NULL COMMENT '保质期（月）',
  `craft` varchar(255) DEFAULT NULL COMMENT '工艺(正味）',
  `packing_specification` varchar(100) DEFAULT NULL COMMENT '包装规格',
  `status` int(10) DEFAULT NULL COMMENT '状态（0未上架，1已上架  2下架',
  `repertory_status` int(255) DEFAULT NULL COMMENT '库存状态（1有货，2缺货）',
  PRIMARY KEY (`id`,`commodity_num`),
  KEY `commodity_create_user_id` (`create_user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8;

