  `status` int(4) NOT NULL COMMENT '订单状态  -10-交易关闭、0-待付款、1-完成、2-待发货、3-待收货、4-待评价、10-退款售后',
  `receiving_id` bigint(20) DEFAULT NULL COMMENT '收货地址ID',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '（订单状态修改时间）',
  `putaway_time` datetime DEFAULT NULL COMMENT '下单时间',
  `logistics_mode` varchar(50) DEFAULT NULL COMMENT '物流方式',
  `payment_mode` varchar(50) DEFAULT NULL COMMENT '支付方式',
  `remark` varchar(255) DEFAULT NULL COMMENT '卖家留言',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=68 DEFAULT CHARSET=utf8;

